import React from "react";

const Login = () => {
  return (
    <section className="loginPage">
      <div className="login">
        <h1>LOGIN</h1>
        <div className="userlog">
            <label >Username:</label>
          <input type="text" />
        </div>
        <div className="passlog">
        <label >Password:</label>
          <input type="text" />
        </div>
        <button>Sumbit</button>
      </div>
    </section>
  );
};

export default Login;
